import React from 'react';
import Aux from '../../hoc/Aux';
import classes from './Layout.css';


const layout = (props) => {
    console.log('[Layout]');
    console.log(props);
    return (
    <Aux>
        <div>Toolbar, SideDrawer, Backdrop</div>
        <main className={classes.Content}>
            {props.children}
        </main>
    </Aux>
);
};
export default layout;
